import React from 'react';


export const PropertyList = () => {
  const properties = [
    { id: 1, image: '', title: 'Property 1' },
    { id: 2, image: '02-small.jpg', title: 'Property 2' },
    { id: 3, image: '03-small.jpg', title: 'Property 3' },
    { id: 4, image: '04-small.jpg', title: 'Property 4' },
    { id: 5, image: '05-small.jpg', title: 'Property 5' },
    { id: 6, image: '06-small.jpg', title: 'Property 6' },
  ];

  return (
    <div className="property-list">
      {properties.map((property) => (
        <div key={property.id} className="property-item">
          <img src={property.image} alt={property.title} className="property-image" />
          <div className="hover-overlay">
            <button className="explore-btn">Explore</button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default PropertyList;
